import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation item to be visible
    await page.waitForSelector('.nav-item[data-page="history"]');

    // Click on the History navigation menu item
    await page.click('.nav-item[data-page="history"]');

    // Wait for the page to load and display the history content
    await page.waitForLoadState('networkidle');

    // Take a screenshot after clicking History
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_history_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_history_clicked.png'));

    // Extract and return meaningful data (for verification)
    const historyContent = await page.evaluate(() => {
      return document.querySelector('.main-content')?.innerText || 'No content found';
    });

    return {
      success: true,
      action: "Clicked on History navigation menu item and loaded history content",
      extractedData: { historyContent },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
